// reference mul mod (q, x^n+1)
static void poly_mul_ref(poly *r, const poly *a, const poly *b)
{
  int i,j;
  uint16_t t[2*WOOKIEE_N];
  for(i=0;i<2*WOOKIEE_N;i++)
    t[i] = 0;
  for(i=0;i<WOOKIEE_N;i++)
    for(j=0;j<WOOKIEE_N;j++)
      t[i+j] += a->coeffs[i] * b->coeffs[j];

  for(i=0;i<WOOKIEE_N;i++)
    r->coeffs[i] = t[i] - t[i+WOOKIEE_N];
}


static unsigned char hamming(unsigned char a)
{
  int i;
  unsigned char r = 0;
  for(i=0;i<8;i++)
    r += ((a>>i) & 1);
  return r;
}

static void poly_getnoise(poly *r)
{
  int i;
  unsigned char buf[2*WOOKIEE_N];
  randombytes(buf, 2*WOOKIEE_N);
  for(i=0;i<WOOKIEE_N;i++)
    r->coeffs[i] = hamming(buf[2*i]) - hamming(buf[2*i+1]);
}

#define NTT_Q 33564673
static int poly32_cmp(int32_t *p1, int32_t *p2)
{
  for(size_t i=0;i<WOOKIEE_N;i++){
    if((p1[i]-p2[i]) % NTT_Q != 0){
      return 1;
    }
  }
  return 0;
}
static int test_ntt(void)
{
  int32_t ntttmp[WOOKIEE_N];
  int err = 0;
  for(int i=0;i<10;i++){
    memcpy(ntttmp, ntt_in[i], sizeof ntttmp);
    poly_ntt(ntttmp);
    if(poly32_cmp(ntttmp, ntt_out[i])){
      err++;
    }

  }
  return err;
}

static int test_invntt(void)
{
  int32_t ntttmp[WOOKIEE_N];
  int err = 0;
  for(int i=0;i<10;i++){
    memcpy(ntttmp, invntt_in[i], sizeof ntttmp);
    poly_invntt(ntttmp);
    if(poly32_cmp(ntttmp, invntt_out[i])){
      err++;
    }

  }
  return err;
}

static int test_polymul(void)
{
  poly a,b,c,cref;

  memset(c.coeffs, 0, WOOKIEE_N*2);
  // uniformly random a
  randombytes((uint8_t *) a.coeffs, WOOKIEE_N*2);
  // binomial b
  poly_getnoise(&b);

  // reduce mod q
  for(size_t i=0;i<WOOKIEE_N;i++){
    a.coeffs[i] &= (WOOKIEE_Q-1);
    b.coeffs[i] &= (WOOKIEE_Q-1);
  }

  // poly mul
  poly_mul_ref(&cref, &a, &b);
  poly_mul(&c, &a, &b);

  // reduce mod q
  for(size_t i=0;i<WOOKIEE_N;i++){
    c.coeffs[i] &= (WOOKIEE_Q-1);
    cref.coeffs[i] &= (WOOKIEE_Q-1);
  }

  if(memcmp(c.coeffs, cref.coeffs, WOOKIEE_N*2)){
    return 1;
  } else {
    return 0;
  }
}

int main(void)
{
  int err = 0;
  printf("testing ntt\n");
  err += test_ntt();
  if(err){
    printf("ERRORS %d/%d ntt\n", err, 10);
  } else {
    printf("OK ntt\n");
  }


  printf("testing invntt\n");
  err = 0;
  err += test_invntt();
  if(err){
    printf("ERRORS %d/%d invntt\n", err, 10);
  } else {
    printf("OK invntt\n");
  }

  printf("testing polymul\n");
  err = 0;
  for(size_t i=0;i<NTESTS;i++){
    err += test_polymul();
  }
  if(err){
    printf("ERRORS %d/%d polymul\n", err, NTESTS);
  } else {
    printf("OK polymul\n");
  }
}
